import './Card.css';

const Card = ({ team }) => {
  const createDiv = el => document.createElement('div');
  const createP = el => document.createElement('p');

  const getTeamInfo = id => {
    console.log(id.venue);
  };

  return (
    <section className='cards'>
      <p onClick={() => getTeamInfo(team)}>{team.name}</p>
    </section>
  )
};

export default Card;
